assert filter_integers(['a', 3.14, 5]) == [5] 
assert filter_integers([1, 2, 3, 'abc', {}, []]) == [1, 2, 3] 

# Test if the function raises a TypeError when non-iterable object is passed
try:
    filter_integers(123)
except TypeError:
    pass
else:
    assert False, "TypeError not raised for non-iterable object"

# Test if the function raises a TypeError when non-integer element is passed
try:
    filter_integers([1, 2, 3, 'abc'])
except TypeError:
    pass
else:
    assert False, "TypeError not raised for non-integer element"

# Test if the function returns an empty list when all elements are non-integers

assert find_zero([1, 2]) == -0.5  # f(x) = 1 + 2x
assert find_zero([-6, 11, -6, 1]) == 1.0  # (x - 1) * (x - 2) * (x - 3) = -6 + 11x - 6x^2 + x^3

# Passing empty list
try:
    find_zero([])
except ValueError as e:
    assert str(e) == "List must have even number of coefficients."

# Passing list with odd number of coefficients
try:
    find_zero([1, 2, 3])
except ValueError as e:
    assert str(e) == "List must have even number of coefficients."

# Passing list with negative coefficients
try:
    find_zero([-1, -2])
except ValueError as e:
    assert str(e) == "List must only have non-zero coefficients."

